import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import ResizableComponent from './Resize';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <ResizableComponent/>
  </React.StrictMode>
);

